import React from 'react';
import './menu2.css';
import {Link} from 'react-router-dom';

const Menu2 = () => {
    return (
        <>
            <nav className="menu2">
                <ul>
                    <li><a href="/App/#yhteystiedot">Yhteystiedot</a></li>
                    <li><a href="/App/#lisatietoja">Lis√§tietoja</a></li>
                    <li><Link to="/App">Etusivu</Link></li>
                </ul>
            </nav>
            <div className="menu2 placeholder"></div>
        </>
    );
};

export default Menu2;
